var $bm_rt;
var quality, radius, startAngle, xt, yt;
quality = clamp(effect('Quality')('ADBE Slider Control-0001'), 0.1, 1000);
radius = $bm_div(effect('Extrude')('ADBE Slider Control-0001'), quality);
startAngle = degreesToRadians($bm_sub(effect('Angle')('ADBE Angle Control-0001'), 90));
xt = $bm_sum(value[0], $bm_mul(radius, Math.cos(startAngle)));
yt = $bm_sum(value[1], $bm_mul(radius, Math.sin(startAngle)));
$bm_rt = [
    xt,
    yt
];

